import Row from "./Row";
import { render } from "react-dom";

export default function Table({ humans, renderHeader }) {
  return (
    <table>
      <tr>{renderHeader()}</tr>
      {humans.map(human => (
        <tr key={human.id}>
          <Row human={human} />
        </tr>
      ))}
    </table>
  );
}
